**Is your feature request related to a problem? Please describe.**
Currently the output is `IDisposableReadOnlyCollection<DisposableNamedOnnxValue>` and `NamedOnnxValue` provides:

```C#
        public IEnumerable<T> AsEnumerable<T>();
        public Tensor<T> AsTensor<T>();
```

In order to get a `float[]` result I can do either:

```C#
            using (var results = _session.Run(inputs))
            {
                return results.First().AsTensor<float>().ToDenseTensor().Buffer.ToArray();
            }
```

or use more `Linq` like

```C#
            using (var results = _session.Run(inputs))
            {
                return results.First().AsEnumerable<float>().ToArray();
            }
```

The latter is faster! 

**System information**
- ONNX Runtime version (you are using): 0.3.0

**Describe the solution you'd like**

Provide 

```C#
        public T[] AsArray<T>();
```

To directly get the array, I know my network outputs a contiguous array.

**Describe alternatives you've considered**

Alternative [Tensor types](https://github.com/Microsoft/onnxruntime/issues/540) that may have easier way to get array.

**Additional context**
[This issue](https://github.com/Microsoft/onnxruntime/issues/673) is related.

It would be easier for some code like this:

auto ts = profiling::Profiler::Instance().StartTime();
...
profiling::Profiler::Instance().EndTimeAndRecordEvent(profiling::EventCategory::NODE_EVENT, name, ts);

**Describe the bug**
To get the results I have tried these two:

```C#
using(var results = _session.Run(inputs))
{
    return results.First().AsEnumerable<float>().ToArray();
}
```

```C#
using(var results = _session.Run(inputs))
{
    return results.First().AsTensor<float>().ToDenseTensor();
}
```

I noticed that the latter is slower than the former, even though there seems to be a copy involved in both (?).

I first thought it is `ToDenseTensor` that has some copying overhead, but used 

```
using (var pin = (tensor as DenseTensor<float>).Buffer.Pin())
```

and still it was 60ms slower! which makes sense because `ToTensor` is already dense so `ToDenseTensor` according to documentation does not copy.

**System information**
- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): Windows 10
- ONNX Runtime installed from (source or binary): nuget
- ONNX Runtime version: 0.3.0

**To Reproduce**
Install 0.3.0 and try consuming the results using `AsTensor` vs `AsEnumerable`

**Expected behavior**
Should be about the same runtime, unless Tensor object creation is heavy

**Additional context**
The final results size is 1000000 which is why copy matters at all
